                                                class="image_title content"
                                        >
                                            <div
                                                    class="title_highlight mt1"
                                            ></div>
                                            <div class="text-size-medium">
                                                In 1974, Frank Van Wezel
                                                invented the first Hi-Tec shoe.
                                                A modest Squash shoe built for
                                                comfort and mobility. This was
                                                the start of of 50 year run that
                                                would shape sport and culture,
                                                and blaze a trail from Shoebury
                                                (Essex) all across the globe.
                                            </div>
